import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({index, getQuestionId, id,props }){

    const q = getQuestionId(props.id);

    return(
        <Paper
            key={index}
        >
            <h1>Detail's page</h1>
            <h1>{q.title}</h1>
            <h3>{q.subtitle}</h3>
              <p>{q.category}</p>         
        </Paper>
    )
}

export default Question;
